  return (
    <Navbar_Admin></Navbar_Admin>
  );
    }
    else if (role==="Teacher") {
      return (
        <Navbar_Teacher></Navbar_Teacher>
      )

    }
  return <SignIn_Admin/> || <Signin_Teacher/>;
}
